import './App.css';
import React from 'react';
import Button from './button';
function App() {

  const [val,setVal]=React.useState("")

   function calc(c){
    setVal(c)
   }

  return (
    <div>

       <p>{val}</p>

       <Button
        c={"1"} 
        calc={calc}
       />
       <br></br><br></br>
       <Button
        c={"2"} 
        calc={calc}
       />

    </div>
  );
}

export default App;
